<!DOCTYPE html>
<html>
<head>
  <title>Jaw-Dropping Graph Visualization with Zoom</title>
  <style>
    /* Add CSS styles for the graph container */
    #graph-container {
      width: 100%;
      height: 100vh;
    }

    /* Add CSS styles for the links (edges) */
    .link {
      stroke: #999;
      stroke-opacity: 0.6;
    }

    /* Add CSS styles for the nodes */
    .node {
      fill: #ff7f0e;
      stroke: #fff;
      stroke-width: 1.5px;
    }

    /* Add CSS styles for the node labels (tooltips) */
    .label {
      font-size: 12px;
      pointer-events: none;
    }
  </style>
  <script src="https://d3js.org/d3.v7.min.js"></script>
</head>
<body>
  <div>
    <label for="attraction">Attraction:</label>
    <input type="range" id="attraction" min="-1000" max="1000" value="-400">
    <span id="attractionValue">-400</span>
  </div>
  <div>
    <label for="repulsion">Repulsion:</label>
    <input type="range" id="repulsion" min="-1000" max="1000" value="400">
    <span id="repulsionValue">400</span>
  </div>
  <div>
    <label for="minDistance">Min Distance:</label>
    <input type="range" id="minDistance" min="1" max="10000" value="20">
    <span id="minDistanceValue">20</span>
  </div>
  <div>
    <label for="maxDistance">Max Distance:</label>
    <input type="range" id="maxDistance" min="1" max="1000" value="500">

  </div>
  <div>
    <label for="centerAttraction">Center Attraction:</label>
    <input type="range" id="centerAttraction" min="-1000" max="1000" value="0">

  </div>

    // Create the D3.js SVG container
    const svg = d3.select("#graph-container").append("svg")
      .attr("width", "100%")
      .attr("height", "100%")
      .call(d3.zoom().on("zoom", zoomHandler))
      .append("g");

    // Create the force simulation
    const simulation = d3.forceSimulation(graphData.nodes)
      .force("link", d3.forceLink(graphData.links).id(d => d.id))
      .force("charge", d3.forceManyBody().strength(-400))
      .force("center", d3.forceCenter(window.innerWidth / 2, window.innerHeight / 2));

    // Add a small force to attract nodes to the center of the screen
    const centerAttractionForce = d3.forceManyBody().strength(0);
    simulation.force("centerAttraction", centerAttractionForce);

    // Function to update the simulation forces
    function updateForces() {
      const attractionValue = parseFloat(document.getElementById("attraction").value);
      const repulsionValue = parseFloat(document.getElementById("repulsion").value);
      const minDistanceValue = parseFloat(document.getElementById("minDistance").value);
      const maxDistanceValue = parseFloat(document.getElementById("maxDistance").value);
      const centerAttractionValue = parseFloat(document.getElementById("centerAttraction").value);

      simulation.force("charge", d3.forceManyBody().strength(attractionValue));
      simulation.force("link").distance(d => {
        return Math.max(minDistanceValue, Math.min(maxDistanceValue, d.target.index === d.source.index ? repulsionValue : 1));
      });
      simulation.force("centerAttraction").strength(centerAttractionValue);

      document.getElementById("attractionValue").textContent = attractionValue;
      document.getElementById("repulsionValue").textContent = repulsionValue;
      document.getElementById("minDistanceValue").textContent = minDistanceValue;
      document.getElementById("maxDistanceValue").textContent = maxDistanceValue;
      document.getElementById("centerAttractionValue").textContent = centerAttractionValue;

      // Restart the simulation after updating forces
      simulation.alpha(1).restart();
    }

    // Update forces when sliders change
    d3.selectAll("input[type=range]").on("input", updateForces);

    // Create the links (edges)
    const link = svg.selectAll(".link")
      .data(graphData.links)
      .enter().append("line")
      .attr("class", "link");

    // Create the nodes
    const node = svg.selectAll(".node")
      .data(graphData.nodes)
      .enter().append("circle")
      .attr("class", "node")
      .attr("r", d => 10)
      .call(d3.drag()
        .on("start", dragstarted)
        .on("drag", dragged)
        .on("end", dragended));

    // Add labels (tooltips) to the nodes
    const label = svg.selectAll(".label")
      .data(graphData.nodes)
      .enter().append("text")
      .attr("class", "label")
      .attr("dx", 25)
      .attr("dy", ".35em")
      .text(d => d.label);

    // Define the tick function to update node and link positions
    function ticked() {
      link
        .attr("x1", d => d.source.x)
        .attr("y1", d => d.source.y)
        .attr("x2", d => d.target.x)
        .attr("y2", d => d.target.y);

      node
        .attr("cx", d => d.x)
        .attr("cy", d => d.y);

      label
        .attr("x", d => d.x)
        .attr("y", d => d.y);
    }

    // Define the drag functions
    function dragstarted(event, d) {
      if (!event.active) simulation.alphaTarget(0.3).restart();
      d.fx = d.x;
      d.fy = d.y;
    }

    function dragged(event, d) {
      d.fx = event.x;
      d.fy = event.y;
    }

    function dragended(event, d) {
      if (!event.active) simulation.alphaTarget(0);
      d.fx = null;
      d.fy = null;
    }

    // Define the zoom handler function
    function zoomHandler(event) {
      const transform = event.transform;
      svg.attr("transform", transform);
    }

    // Update the simulation at each tick
    simulation.on("tick", ticked);

    // Initialize forces with default values
    updateForces();
  </script>
</body>
</html>
